import React from "react";
import { Line } from "react-chartjs-2";

const data = {
  labels: ["", "", "", "", "", ""],
  datasets: [
    {
      data: [12, 19, 3, 5, 2, 3],
      backgroundColor: "pink",
      borderColor: "red",
      fill: true,
    },
  ],
};

const options = {
  plugins: {
    legend: {
      display: false,
    },
  },
  scales: {
    y: {
      display: false,
    },
    x: {
      display: false,
    },
  },
  radius: 0,
  tension: 0.4,
};

const LineChart = () => (
  <>
    <Line data={data} options={options} />
  </>
);

export default LineChart;
